import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export function HomePage(){
  return (
    <Router>
      <h1>Login</h1>

      <Switch>
          <Route exact path="/">
            <Home />
          </Route>
    </Switch>
    </Router>
  )
}
